import { Accordion, Button, Row } from "react-bootstrap";

const QA = ({ dataview }) => {
    return (
        <>
            <Row>
                <Accordion>
                    <Accordion>
                        {dataview.length >= 1 ? (
                            dataview.map((item, index) => {
                                return (
                                    <Accordion.Item key={index} eventKey={item.id}>
                                        <Accordion.Header>{item.q}</Accordion.Header>
                                        <Accordion.Body>
                                            <div className="px-3 d-inline">{item.a}</div>
                                            <Button className="btn-color">مسح السؤال</Button>
                                        </Accordion.Body>
                                    </Accordion.Item>
                                );
                            })
                        ) : (
                            <h2 className="fs-4 text-center">لا توجد اسئلة</h2>
                        )}
                    </Accordion>


                </Accordion>
            </Row >
        </>
    )
}
export default QA;
